config = {'concurrency': 100, 'method': 'get', 'options': {'cookies': {
    'test_cookie': 'cookie_value'}, 'headers': {'name': 'value'}},
    'request_nums': 1, 'url': 'http://localhost:5000'}
result = benchmark(**config)
for response in result.responses:
    for cookie_pair in config['options']['cookies']:
        assert _str(cookie_pair) in response.text
    for header_pair in config['options']['headers'].items():
        assert 'HTTP_{}={}'.format(header_pair[0], header_pair[1]
            ) in response.text
    assert self.get_count() == config['concurrency']
